import React from 'react';

const HomePage = () => (
  <div className="home-page">
    <h1>Bem-vindo à Brasfi</h1>
    <p>A Brasfi é líder em soluções de gestão corporativa, oferecendo sistemas robustos desenvolvidos em Java Spring Boot com front-end em React. Aproveite uma plataforma intuitiva e segura para gerenciar seus dados.</p>
  </div>
);

export default HomePage;
